//import React from 'react';
//import ReactDOM from 'react-dom';

class MeuComponente extends React.Component{
    //Definição do componente vai aqui
      render(){
        const primeiro = {
          padding: "10px",
          marginLeft: "20px"
        };
        const segundo = {
          backgroundColor: "#FFFFCC",
          padding: "5px"
        };
        const lista = {
          padding: "10px"
        };
        return (
          <section>
          <div style={{backgroundColor: "#FFE5CC"}}>
            <div style={primeiro}>
              <h1>CC4670 - Computação Móvel</h1>
              <h2>React</h2>
              <h3>Biblioteca JavaScript para criar interfaces com o usuário</h3>
              <p>Primeira Aula</p>
            </div>
            <div style={segundo}>  
              <h2>Vamos utilizar:</h2>
              <ul style={{fontSize: 21}}>
              <li style={lista}>HTML</li>
              <li style={lista}>CSS</li>
              <li style={lista}>JavaScript</li>
              </ul> 
             </div>
          </div> 
          
          </section>
        )
      }
    }
    
    ReactDOM.render(<MeuComponente />, document.getElementById('root'));
